import React from 'react'

const DialogBox = () => {

const refresh = () => {
  window.location.reload()
}

const zoomIn = () => {
  document.body.style.zoom("150%");
}

const zoomOut = () => {
  document.body.style.zoom("100%");
};

  return (
    <div
      style={{
        zIndex: 6,
        position: "absolute",
        background: "rgba(255, 255, 255, 1)",
        borderRadius: "16px",
        backdropFilter: "blur(5px)",
        webkitBackdropFilter: "blur(5px)",
        border: "5px solid rgba(0, 0, 0, 0)",
        position: "fixed",
        left: "15%",
        transform: "translate(-35%,30%)",
        width: "15%",
        height: "135px",
      }}
    >
      <button style={{ background: "none", border: "none" }}>
        &nbsp;&nbsp;&nbsp;&nbsp;N e w &nbsp;&nbsp;&nbsp;F i l e
      </button>
      <br />
      <br />
      <button style={{ background: "none", border: "none" }}>
        &nbsp;&nbsp;&nbsp;&nbsp;Z o o m &nbsp;&nbsp;&nbsp;i n
      </button>
      <br />
      <br />
      <button style={{ background: "none", border: "none" }}>
        &nbsp;&nbsp;&nbsp;&nbsp;Z o o m &nbsp;&nbsp;&nbsp;o u t
      </button>
      <br />
      <br />
      <button style={{ background: "none", border: "none" ,cursor:"pointer"}} onClick={() => refresh()}>
        &nbsp;&nbsp;&nbsp;&nbsp;R e f r e s h
      </button>
    </div>
  );
}

export default DialogBox
